def applyThresholding(df, threshold = False, thresholdCol = 'confidence', predictionCol = 'prediction'):
    if type(threshold) == float:
        df = df.filter(col(thresholdCol) > threshold)
    elif type(threshold) == list:
        print('Warning: If length of threshold != number of classes, the thresholding may work unpredictably')
        for i,value in enumerate(threshold):
            df = df.filter(((col(predictionCol) == i) & (col(thresholdCol) > value)) | \
                            (col(predictionCol) != i))
    elif not threshold: return df
    else: raise nameError('"threshold" must be either be a float or list of length equal to the number of classes')
    return df

