def evaluateAllData(filename, save = False, queryable = 'dcr_WD_res', sample = False, featureCols = None,
                    threshold = False, QCthreshold = 0.5, qualityControl = True, labelCol = 'is_good'):

    df = select_unlabelled_data(table = 'gaia_source', filename = filename, features = featureCols,
                      normalise = True, scalerType = 'standard', sample = sample, labelCol = labelCol)

    df = df.select(['source_id', 'probability', 'prediction'])

    df = df.withColumn("probability", vector_to_array(col("probability")))\
                    .select(['source_id', 'prediction'] + [col("probability")[i] for i in range(2)])\
                        .withColumn('confidence', greatest(col('probability[0]'), col('probability[1]')))\
                            .select(['source_id', 'prediction', 'confidence'])

    if save:
        if not dev_run:
            df.write.mode('overwrite').save(f"{user_home}/WD_detection/results/{save}.parquet", format="parquet")
            print(f'data saved at {user_home}/ML_cuts/results/{save}.parquet')

    if threshold:
        df = applyThresholding(df = df, threshold = threshold, thresholdCol = 'confidence', predictionCol = 'prediction')

    if queryable:
        df.createOrReplaceTempView(queryable)

    if qualityControl:
        if not queryable:
            raise nameError('For quality control makeQueryable must be True')
        df = applyQualityControl(catalogue = queryable, QCcatalogue = 'dcr_spurious_sources', 
                                 threshold = QCthreshold, return_confidence = False)
        df.createOrReplaceTempView(queryable)

    return df
